(25, '2014-06-22', '', 'Caida sobre hombro y rodilla izquierdas\nConsulta en una guardia: rx y dg de tumor de hùmero\nAntecedente de luxaciòn de hombro izquierdo hace 15 años reducido bajo anestesia gral, desde entonces refiere molestias sin sensaciòn de inestabilidad\nEx hombro izq: estable, leve limitaciòn de la rotaciòn interna. No se palpan tumores. Rto s/p', 4, 1, 1, 1, 0, 0, 0, 0, 1, 0, '2014-07-07', NULL, 34, 36, NULL, NULL),
(27, NULL, '', 'desde hace mas de 1 año disestesias ambas manos con dolor nocturno que le impide descansar desde hace 5 meses, peor derecha\ntoma AINES todos los dìas por dolores articulares, sin trastornos gàstricos\nex ambas manos: sin hipoestesia, sin hipotrofia tenar. Tinel y Phalen (+-)', NULL, NULL, 2, 0, 0, 0, 0, 0, 1, 0, '2014-07-08', NULL, 36, 35, NULL, NULL),
(35, NULL, '', 'desde hace 2 meses dolor en pulgar derecho sin antecedente traumatico\ngatilla con frecuencia\ndolor VAS 8', NULL, NULL, 0, 0, 0, 0, 0, 0, 0, 0, '2014-07-29', NULL, 39, 38, NULL, NULL),
(36, '2014-07-09', '', 'El 9/7 siente contractura en espalda y dolor espontaneo intolerable, luego nota separación anormal de la escapula al extender el hombro para lo cual tiene dificultad\r\nConsultó con dr. Enrique Pereira quien diagnostico escapula alada, pidió EMG e indicó ejercicios, Diclofenac y Pregabalina. Actualmente siente dolor VAS 2, dificultad para extender y abeducir el hombro y debilidad en todo el miembro\r\nEx MSD: en reposo s/p. Al extender el brazo a 90° se observa saliencia muy evidente de toda la escapla hacia latera (serrato M0)l, puede elevar el hombro y mover el cuello sin dificultad (trapecio M5). Tinel dudoso sobre parrilla costal lateral para nervio de Bell, hueco s/p, maniobras Diez Mitchans s/p. Sensibilidad en MSD s/p, M5 en todos los músculos.\r\nDg: ESCAPULA ALADA', 4, 5, 0, 1, 0, 0, 0, 0, 1, 0, '2014-07-31', NULL, 40, 39, NULL, NULL),
(37, '2014-07-01', '', 'el 1/7 tx de muñeca izquierda durante accidente de moto. No consulto.\nEl 22/7 consulta en Htal Santojani: rx y dg de fx de escafoides y yeso ABD\nHoy esta con yeso, la rx demuestra reabsorcion de los bordes de la fx con tendencia a la seudoartrosis ', 6, 0, 1, 1, 0, 0, 0, 0, 1, 0, '2014-08-04', NULL, 41, 40, NULL, NULL),
(38, '2014-07-31', '', 'el 31/7/14 sufre herida cortante con cuchillo mientras cocinaba. Consulta en una guardia: toilette, cura palna y derivacion. Se aplica TAT por su cuenta.\nEX: herida oblicua de 1 dm en dorso de mano. Incapacidad para extender MTC-F del III', 1, 4, 0, 1, 0, 0, 0, 0, 1, 0, '2014-08-04', NULL, 42, 41, NULL, NULL),
(39, NULL, '', 'dolor y parestesias en mano derecha de 4 meses de evolucion.\nEx: hipoestesia area mediano bilateral.Tinel (+) para ambos medianos. Phalen (+).Trofismo muscular conservado.\nEMG: med der VCS 14m/s latencia 10.3ms. med izq 30m/s lat 4.6ms', NULL, NULL, 0, 0, 0, 0, 0, 0, 1, 0, '2014-08-05', NULL, 43, 42, NULL, NULL),
(40, NULL, '', 'luego de una inflamacion tendinosa en muñeca izq continuo con dolor y repentinamente nota que no puede extender el pulgar el 22/7 se realiza en este servicio la transferencia de extensor propio del II al EPL', NULL, NULL, 1, 0, 0, 0, 0, 0, 1, 0, '2014-08-07', NULL, 44, 43, NULL, NULL),
